import React from "react";
import './App.css'
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Dashboard from './components/About/About';
import Preferences from './components/Profile/Profile';

function App() {
  return (
      <div className="wrapper">
        <h1>Application</h1>
        <BrowserRouter>
          <Switch>
            <Route path="/dashboard">
              <Dashboard />
            </Route>
            <Route path="/preferences">
              <Preferences />
            </Route>
          </Switch>
        </BrowserRouter>
      </div>
  );
}

export default App;
